import './App.css';

function App() {
  return (
    <div>
      <div className="p-10 max-w-md mx-auto bg-amber-50 rounded-xl shadow-md">
        <h1 className="text-2xl font-bold text-gray-800">Привет из Tailwind!</h1>
        <p className="mt-2 text-gray-600">Если текст красивый — Tailwind работает ✅</p>
        <button className="mt-4 bg-amber-600 hover:bg-amber-700 text-white font-semibold py-2 px-4 rounded-lg transition">
          Кнопка
        </button>
      </div>
    </div>
  );
}

export default App;
